INSERT INTO `products` VALUES (4,'Soup Pot stickers','Large-sized stickers, for use on collection soup pots','Dress up your donation pot with the Souper Bowl of Caring logo.',1.00,0.00,NULL,1,1,11974,'11/54/55/1636.jpg',1,1,0,0,'0000-00-00 00:00:00','2013-01-04 11:06:47'),(8,'Posters','Official Poster','Promote your Souper Bowl of Caring event with this year\'s new Tackle Hunger poster.  <b>NOTE:</b> All <a href=\"/profile/find/\">Registered</a> participants receive two posters with their resource kits. Want to post more? Order additional posters here to make sure everyone knows about your event.',1.00,0.00,NULL,1,1,440520,'26/98/60/1670.jpg',1,1,1,0,'0000-00-00 00:00:00','2013-01-04 11:06:47'),(12,'Logo T-shirts','','Our signature purple t-shirt features the Souper Bowl of Caring logo and is perfect to wear during your Souper Bowl event.  Available in sizes Small, Medium, Large, Extra-Large, 2XL and 3XL.',12.00,0.00,NULL,1,1,113,'56/09/71/1665.jpg',1,0,0,4,'0000-00-00 00:00:00','2013-01-04 11:06:47'),(15,'&quot;If I don\'t, who will?&quot; T-shirts','','The &quot;If I don\'t, who will?&quot; t-shirt is now available! This simple, yet bold statement has been a favorite across the country. Order these shirts today to wear for your Souper Bowl of Caring event.',12.00,0.00,NULL,1,1,471,'11/41/94/1655.jpg',0,0,0,5,'0000-00-00 00:00:00','2013-01-04 11:06:47'),(121,'2008 Video','','The 2008 6-minute video is a great visual tool to educate your group about the impact of hunger in your community. It\'s also a great way to get others excited about your Souper Bowl event. Video also includes a 30-second Public Service Announcement to share with your local media.',5.00,0.00,NULL,1,1,3000,'26/74/16/1647.jpg',0,0,0,0,'0000-00-00 00:00:00','2013-01-04 11:06:47'),(122,'\"Hungry to Serve\" T-shirts','','The \"Hungry to Serve\" t-shirt is now available!  This simple, yet bold statement has been a favorite across the country.  Order these shirts today to wear for your Souper Bowl of Caring event',12.00,5.00,NULL,1,1,0,'48/60/02/1667.jpg',0,0,0,0,'0000-00-00 00:00:00','2013-01-04 11:06:47'),(123,'Pink Ringer Shirts','','These fashionable shirts are a great way to show your Souper Bowl of Caring support year-round. Note-the fit of these shirts is smaller than a regular t-shirt. They are not youth sizes, but do offer a much more tailored fit.',12.00,5.00,NULL,1,1,0,'38/09/21/1664.jpg',0,0,0,0,'0000-00-00 00:00:00','2013-01-04 11:06:47'),(124,'Yellow Ringer Shirt','','Yellow shirt featuring the Souper Bowl logo',12.00,5.00,NULL,1,1,0,'98/80/62/1639.jpg',0,0,0,0,'0000-00-00 00:00:00','2013-01-04 11:06:47'),(125,'Hunger Education DVD','DVD featuring facts about hunger','This 6-minute video is youth-oriented and is a great tool to help educate young people on the realities of hunger and poverty.',5.00,0.00,NULL,1,1,110,'01/34/59/1654.jpg',1,0,1,0,'0000-00-00 00:00:00','2013-01-04 11:06:47'),(126,'Promotional DVD','DVD featuring the history of the Souper Bowl of Caring','This 6-minute DVD features stories from Souper Bowl of Caring Founder, Brad Smith, as well as testimonials from young people involved over the past twenty years. This video celebrates the successes of the Souper Bowl of Caring and tells the story of how this movement is impacting the lives of people across the country.',5.00,0.00,NULL,1,1,145,'75/90/51/1660.jpg',1,0,1,0,'0000-00-00 00:00:00','2013-01-04 11:06:47'),(128,'Jacksonville Jaguars:Plan A','','',60.00,50.00,NULL,1,1,0,'',0,0,0,0,'2009-12-07 15:09:54','2009-12-07 15:09:54'),(129,'Posters (Pack of 10)','Package of Posters','Promote your Souper Bowl of Caring event with this year\'s new Tackle Hunger poster.  <b>NOTE:</b> All <a href=\"/profile/find/\">Registered</a> participants receive two posters with their resource kits. Want to post more? Order additional posters here to make sure everyone knows about your event.',5.00,0.00,NULL,1,0,110130,'15/02/51/1669.jpg',1,0,0,0,'2009-12-11 18:31:47','2013-01-04 11:06:47'),(130,'Posters (Pack of 25)','Package of Official Posters','Promote your Souper Bowl of Caring event with this year’s new Tackle Hunger poster.  &lt;b&gt;NOTE:&lt;/b&gt; All &lt;a href=&quot;/profile/find/&quot;&gt;Registered&lt;/a&gt; participants receive two posters with their resource kits. Want to post more? Order additional posters here to make sure everyone knows about your event.',8.00,0.00,NULL,1,1,110130,'11/76/56/1674.jpg',1,0,0,0,'2009-12-13 18:25:44','2013-01-04 11:06:47'),(131,'Posters (Pack of 50)','Package of Official Posters','Promote your Souper Bowl of Caring event with this year’s new Tackle Hunger poster.  &lt;b&gt;NOTE:&lt;/b&gt; All &lt;a href=&quot;/profile/find/&quot;&gt;Registered&lt;/a&gt; participants receive two posters with their resource kits. Want to post more? Order additional posters here to make sure everyone knows about your event.',15.00,0.00,NULL,1,1,110130,'28/35/09/1673.jpg',1,0,0,0,'2009-12-13 18:25:58','2013-01-04 11:06:47'),(132,'Posters (Pack of 100)','Package of Posters','Promote your Souper Bowl of Caring event with this year’s new Tackle Hunger poster.  &lt;b&gt;NOTE:&lt;/b&gt; All &lt;a href=&quot;/profile/find/&quot;&gt;Registered&lt;/a&gt; participants receive two posters with their resource kits. Want to post more? Order additional posters here to make sure everyone knows about your event.',25.00,0.00,NULL,1,1,110130,'34/07/23/1672.jpg',1,0,0,0,'2009-12-13 18:26:14','2013-01-04 11:06:47'),(133,'Ceramic Soup Pots','A miniature cermaic soup pot featuring our logo','These ceramic soup pots are a mini-representation of the soup pots used to collect money and cans each year for Souper Bowl of Caring.  Standing at about 5 inches tall, they are great for holding pencils, small plants, or simply displaying proudly on your shelf or desk.',10.00,5.00,NULL,1,0,0,'45/55/03/1663.jpg',0,0,0,0,'2010-01-11 18:39:10','2013-01-04 11:06:47'),(134,'Souper Bowl of Caring Donation','Donate directly to Souper Bowl of Caring','Contribute to helping fight hunger with a donation to Souper Bowl of Caring. 100% of all proceeds from our online store help support program costs for Souper Bowl of Caring.',1.00,0.00,NULL,1,0,0,'63/54/34/1641.jpg',1,1,0,0,'2010-11-04 11:46:12','2013-01-04 11:06:47'),(135,'Tackle Hunger Tote','Reusable grocery bag featuring our logo','Help the environment and make a difference in the fight against hunger. Each eco-friendly Souper Bowl of Caring bag replaces more than 3,000 environmentally destructive single use bags. Made of recyclable polypropylene, each bag can be used hundreds of times and safely holds over 25 pounds of groceries. Measures 13” x 16” with bottom insert, is non-toxic and non-allergenic. Wash in cold water and air-dry.',5.00,0.00,NULL,1,0,649,'17/36/19/1668.jpg',1,0,0,0,'2010-11-10 14:57:03','2013-01-04 11:06:47'),(136,'Souper Bands','Silly band bracelets featuring Souper Bowl of Caring','There\'s nothing silly about showing your support for the fight against hunger. Wear your Souper Bowl of Caring bands with pride! Shapes include: heart, football, soup ladle, tackle, and hunger. 10 shaped rubber bands are included per package.',5.00,0.00,NULL,1,0,0,'04/56/83/1638.jpg',0,0,0,0,'2010-11-10 15:00:37','2013-01-04 11:06:47'),(137,'Tackle Hunger Jersey','Jersey-style T-shirt featuring our logo','Tackle hunger in the jersey designed exclusively for our national movement. Wear our black 50% polyester / 50% cotton jersey with white contrast rib-knit v-neck collar and show the world you’re not sitting on the sidelines in the fight against hunger.',15.00,0.00,NULL,1,0,184,'11/08/43/1643.jpg',1,0,0,0,'2010-11-10 15:19:32','2013-01-04 11:06:47'),(138,'Tackle Hunger Tote (Pack of 5)','','Help the environment and make a difference in the fight against hunger. Each eco-friendly Souper Bowl of Caring bag replaces more than 3,000 environmentally destructive single use bags. Made of recyclable polypropylene, each bag can be used hundreds of times and safely holds over 25 pounds of groceries. Measures 13” x 16” with bottom insert, is non-toxic and non-allergenic. Wash in cold water and air-dry.',20.00,0.00,NULL,1,0,649,'57/73/21/1642.jpg',1,0,0,0,'2010-11-16 12:17:12','2013-01-04 11:06:47'),(139,'Participant Resource Kit','Help recruit local groups to hold a SBoC collection and donate to your agency!','Every registered participant receives a resource kit to help plan and promote their event. The kit includes posters, a sticker, inserts and instructions on how to participate. \r\n\r\nThis is a limited-time opportunity for other non-profit organizations to order these kits to distribute in your community. Include a personalize letter to encourage local churches and schools to consider your organization as the recipient of their collection.',1.00,0.00,NULL,1,0,2500,'81/37/20/1649.jpg',1,1,0,0,'2011-01-21 18:42:50','2013-01-04 11:06:47'),(140,'Participant Resource Kit (Pack of 10)','','Every registered participant receives a resource kit to help plan and promote their event. The kit includes posters, a sticker, inserts and instructions on how to participate. \r\n\r\nThis is a limited-time opportunity for other non-profit organizations to order these kits to distribute in your community. Include a personalize letter to encourage local churches and schools to consider your organization as the recipient of their collection.',10.00,0.00,NULL,1,0,2500,'95/17/68/1657.jpg',1,1,0,0,'2011-01-21 19:24:28','2013-01-04 11:06:47'),(141,'Overnight Shipping','','',20.00,0.00,NULL,1,0,0,'',1,1,0,0,'2011-01-27 13:33:22','2011-01-27 13:33:22'),(142,'Soup Pot Stickers (Pack of 5)','Large-sized stickers, for use on collection soup pots','Dress up your donation pot with the Souper Bowl of Caring logo.',5.00,NULL,NULL,1,NULL,11974,'53/46/64/1675.jpg',1,0,0,0,'2011-12-29 09:10:30','2013-01-04 11:06:47');
